import React, {useState, useEffect} from 'react';
import io from 'socket.io-client';

let socket;

const MeetWindow =()=>{
    const ENDPOINT="localhost:5000";
    useEffect(() => {


        socket = io(ENDPOINT);
        socket.emit("hi");
        console.log('hi');
    },[])
    return(<h1>go00</h1>)
};

export default MeetWindow;
